import { useEffect } from "react";
// import { Tab } from 'bootstrap'
import ListMedicines from "../pages/listMedicine";
import AddEditMedicine from "../pages/AddEditMedicine.js";

export default function Medicines() {
  useEffect(() => {
    const triggerTabList = [].slice.call(document.querySelectorAll('#myTab button'));
    triggerTabList.forEach(function (triggerEl) {
      const tabTrigger = new Tab(triggerEl);
      triggerEl.addEventListener('click', function (event) {
        event.preventDefault();
        tabTrigger.show();
      });
    });
  }, []);

  return (
    <div>
      <div className="container m-5">
        <ul className="nav nav-tabs" id="myTab" role="tablist">
          <li className="nav-item" role="presentation">
            <button
              className="nav-link active"
              id="home-tab"
              data-bs-toggle="tab"
              data-bs-target="#home"
              type="button"
              role="tab"
              aria-controls="home"
              aria-selected="true"
            >
              Medicines
            </button>
          </li>
          <li className="nav-item" role="presentation">
            <button
              className="nav-link"
              id="add-medicine-tab"
              data-bs-toggle="tab"
              data-bs-target="#add-medicine"
              type="button"
              role="tab"
              aria-controls="add-medicine"
              aria-selected="false"
            >
              Add Medicine
            </button>
          </li>
        </ul>
        <div className="tab-content" id="myTabContent">
          <div
            className="tab-pane fade show active"
            id="home"
            role="tabpanel"
            aria-labelledby="home-tab"
          >
            <ListMedicines />
          </div>
          <div
            className="tab-pane fade"
            id="add-medicine"
            role="tabpanel"
            aria-labelledby="add-medicine-tab"
          >
            <AddEditMedicine />
          </div>
        </div>
      </div>
    </div>
  );
}
